import React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';

const Buttons = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: '#f8f9fa', boxShadow: 'none' }}>
      <Toolbar sx={{ justifyContent: 'space-between' }}>
        <Typography variant="h6" noWrap component="div" sx={{ color: 'black' }}>
          SS
        </Typography>
        <ButtonGroup >
          <button className="head-buttons"><a style={{unde}}href='#'>PORTFOLIO</a></button>
          <button className="head-buttons">ABOUT</button>
          <button className="head-buttons">RESUME</button>
          <button className="head-buttons">CONTACT</button>
          <button className="head-buttons">GITHUB</button>
          <button className="head-buttons">LINKEDIN</button>
          {/* Add more buttons as needed */}
        </ButtonGroup>
      </Toolbar>
    </AppBar>
  );
};

export default Buttons;
